import { useState } from 'react';

export default function Login() { 
    return (
        <> 
            <form class="credentials-form"> 
                <input type="username" placeholder="Username"/> 
                <input type="password" placeholder="Password"/> 
                <button type="submit"> 
                    Login 
                </button>
            </form> 
        </> 
    ); 
}
